import React from "react";
import styles from "./styles.css";

const Header = () => {

    return (
        <header>
            <h1>Mi Tiendita OnLine</h1>
                <nav>
                    <p>Inicio</p>
                    <p>Ofertas</p>
                    <p>Nosotros</p>
                    <p>Ayuda</p>
                </nav>
        </header>
    )
}

export default Header;
